// 保存URLの取得（なければトップへ）
const saved = localStorage.getItem("postLoginRedirect") || window.location.origin;
localStorage.removeItem("postLoginRedirect"); // 使い捨て

// オープンリダイレクト対策：同一オリジンのみ許可
function safeRedirect(url) {
  try {
    const u = new URL(url, window.location.origin);
    if (u.origin === window.location.origin) return u.href;
  } catch (_) {}
  return window.location.origin; // フォールバック（パスなしトップ）
}

// ループ回避：/login や /auth/callback だったらトップへ
const targetUrl = safeRedirect(saved);
if (targetUrl.includes("/login") || targetUrl.includes("/auth/callback")) {
  window.location.href = window.location.origin;
} else {
  window.location.href = targetUrl;
}

return { ok: true, redirectTo: targetUrl };

